(function(){
    const pics = {
        small: "data:image/png;base64,",
        big: "data:image/png;base64,"
    }

    const firstName = (function*(){
        while(true) {
            yield 'Пузислав';
            yield 'Шерстихвост';
            yield 'Кусемир';
            yield 'Цапохват';
            yield 'Мясополк';
            yield 'Мышебор';
        }
    })();
    
    const lastName = (function*(){
        while(true) {
            yield 'Мурлыкин';
            yield 'Замяуцких';
            yield 'Рыбоедов';
            yield 'Тыгыдыкский';
            yield 'Сметанкин';
            yield 'Вертихвостов';
            yield 'Укусьев';
        }
    })();
    
    function searchAndReplace() {
        const nameNodes = document.querySelectorAll(
            [
                '.resume-search-item__fullname',
                '*[data-qa="resume-personal-name"] span',
                '*[data-qa="similar-resumes-block-item-name"]',
            ].join(', ')
        );
    
        for(const node of nameNodes) {
            node.dataset.fakeName =
                node.dataset.fakeName || `${firstName.next().value} ${lastName.next().value}`;
            node.textContent = node.dataset.fakeName;
        }
    
        const smallPicNodes = document.querySelectorAll('img.resume-userpic__photo');
    
        for(const pic of smallPicNodes) {
            pic.src = pics.small;
        }
    
        const bigPicNodes = document.querySelectorAll('img.resume-photo__image');
    
        for(const pic of bigPicNodes) {
            pic.src = pics.big;
        }
    }
    
    new MutationObserver(searchAndReplace).observe(
        document.documentElement,
        {childList: true, subtree: true},
    );

    document.addEventListener("readystatechange", function() {
        console.log("plugin: readystatechange", document.readyState);

        searchAndReplace();
    })
})();